import {  categoriesRedux,} from './redusers';
import {cat, products} from './actions';
import {  createStore, bindActionCreators } from "redux";
const store = createStore(categoriesRedux);
const {dispatch, subscribe, getState} = store;


export const {catDispatch, prodDispatch} = bindActionCreators({
    catDispatch: cat,
    prodDispatch:products
}, dispatch);
